import React from 'react';
import { Router, Route, Switch } from 'react-router-dom'
import './App.css'

import NavBar from './components/NavBar';
import Home from './components/Home';

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Switch>
          <Route path={'/'} exact component={Home} />
        </Switch>
      </Router>
    </div>
  )
}

export default App;
